import React, { useState, useEffect } from 'react';

const DataFetchingComponent = ({ render }) => {
  const [data, setData] = useState(null);
  const [link, setLink] = useState(null); // Додали стейт для посилання

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://api.adkey-seo.com/api/website/get-website/295');
        if (!response.ok) {
          throw new Error('Failed to fetch data');
        }
        const responseData = await response.json();
        setData(responseData);
        setLink(responseData.link); // Встановлюємо значення посилання в стейт
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      {render({ data, link })} {/* Передаємо об'єкт з даними та посиланням у компонент-дитину */}
    </div>
  );
};

export default DataFetchingComponent;
